const MyProducts = () => {
  // Supongamos que tienes un array de objetos que representan tus productos
  const products = [
    {
      id: 1,
      imageSrc: 'ruta/a/la/imagen1.jpg',
      title: 'Producto 1',
      price: 19.99,
    },
    {
      id: 2,
      imageSrc: 'ruta/a/la/imagen2.jpg',
      title: 'Producto 2',
      price: 29.99,
    },
    {
      id: 3,
      imageSrc: 'ruta/a/la/imagen3.jpg',
      title: 'Producto 3',
      price: 39.99,
    },
  ];

  return (
    <section id="productos" className="main-section">
      <h2>Productos</h2>
      <ul>
        {products.map((product) => (
          <li key={product.id}>
            <ProductCard
              imageSrc={product.imageSrc}
              title={product.title}
              price={product.price}
            />
          </li>
        ))}
      </ul>
    </section>
  );
};

export default MyProducts;
